The &lt;a href="2014%20Caribbean%20Cup"&gt;2014 Caribbean Cup&lt;/a&gt; is an international &lt;a href="association%20football"&gt;football&lt;/a&gt; competition that is scheduled to take place 11–18 November 2014. The competition is a qualifying tournament for the &lt;a href="2015%20CONCACAF%20Gold%20Cup"&gt;2015 CONCACAF Gold Cup&lt;/a&gt; and &lt;a href="Copa%20Am%C3%A9rica%20Centenario"&gt;Copa América Centenario&lt;/a&gt;.
